    false,nt"url": null,nt"notes": "TASK ORDER NAME: VIRGINIA AND MARYLAND
    LIDAR ACQUISITION FOR SANDY RESPONSE CONTRACT NUMBER: W912P9-10-D-0533 TASK ORDER
    NUMBER: W81C8X2314841 Woolpert Project Number: 72903 HQUSACE required high-resolution
    digital elevation data developed from airborne LiDAR technology for the Assateague
    Island, MD; Assateague Island, VA; Tangier Island, VA; Cape Henry to Willoughby
    Point, VA; AOIs for a total of approximately eighty (80) square miles in the North
    Atlantic Division. FINAL DELIVERABLES: The final deliverables are listed below.
    The final LiDAR data was delivered in a UTM projection tiling format, based on a
    modular layout. The tiles were clipped to eliminate overlap between adjacent tiles.
    The 1000 meter x 1000 meter tile file name was derived from the National Grid naming
    convention.",nt"license_title": null,nt"extras": [{ntt"key": "bbox-east-long",ntt"value":
